const requestAPI = async () => {
  try {
    const request = await fetch('https://swapi.dev/api/planets');
    const response = await request.json();
    const { results } = response;
    results.forEach((ele) => {
      delete ele.residents;
    });
    return results;
  } catch (error) {
    throw new Error(error);
  }
};

export default requestAPI;
